import React from 'react'
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import {useState,useEffect} from 'react';
import { useNavigate } from 'react-router-dom';
import Garbage from './Garbage';
import uuid from 'react-uuid';
import axios from 'axios';
function Add() {
  const [id,setId]=useState('')
    const [gbid,setEmpname]=useState('')
    const [gbname,setAge]=useState('')
    const [quantity,setDesignation]=useState('')
    const [description,setSalary]=useState()

    useEffect(()=>{
      setId(uuid().slice(0,8))

    },[])
    const history=useNavigate()
    const handleAdd=async(e)=>{
      e.preventDefault()    
      const body={
        id,
        gbid,
        gbname,
        quantity,
        description
      }
      const result = await axios.post('http://localhost:8000/addgarbages',body)
      console.log(result);
      history('/')
      }
  return (
    <>
    <h1 className='text-warning text-center'>Add Garbage details</h1>


        <Form className='border border-3 p-1'>
        {/* <Form.Group className="mb-2">
            <Form.Label>ID</Form.Label>
            <Form.Control type="text" placeholder="Enter your id" 
            // value={id} 
            onChange={(e)=>setId(e.target.value)} required/>
        </Form.Group> */}
        <Form.Group className="mb-2">
            <Form.Label>Name</Form.Label>
            <Form.Control type="text" placeholder="Enter your Name" 
            // value={gbid} 
            onChange={(e)=>setEmpname(e.target.value)} required/>
        </Form.Group>
        <Form.Group className="mb-2">
            <Form.Label>Age</Form.Label>
            <Form.Control type="text" placeholder="Enter your Age" 
            // value={gbname} 
            onChange={(e)=>setAge(e.target.value)} required/>
        </Form.Group>
        <Form.Group className="mb-2">
            <Form.Label>Designation</Form.Label>
            <Form.Control type="text" placeholder="Enter your Designation" 
            // value={quantity} 
            onChange={(e)=>setDesignation(e.target.value)} required/>
        </Form.Group>
        <Form.Group className="mb-2">
            <Form.Label>Salary</Form.Label>
            <Form.Control type="text" placeholder="Enter your Salary" 
            // value={description} 
            onChange={(e)=>setSalary(e.target.value)} required/>
        </Form.Group>
        <Button variant="primary" type="submit" onClick={(e)=>handleAdd(e)}>
            Add
        </Button>
    </Form>
    </>
  )
}

export default Add
